        const {transactions, initials, logInNewEntry} = this.props;
        return (
            <div>
                <h3>{initials}</h3> 




                <Button 
                    color="primary"
                    onClick={logInNewEntry}
                >
                    Log {initials} in to core
                </Button>
            </div>
        );
  }
}
